import React from 'react'
import Todoitems from './Todoitems'

const Todos = (props) => {
  return (
    <div className='container'>
      <h2 className='text-center my-3'>Todo List</h2>
      {props.todos.map((todos)=>{
        return <Todoitems bonda={todos} />
      })}
      
    </div>
  )
}

export default Todos
